import React, { Component } from 'react'
import { NavLink, withRouter } from "react-router-dom";

export default class Card extends Component {
  render() {
    return (
      <NavLink to={`/product/${this.props.product._id}`}className="product-card">

    </NavLink>
    )
  }
}
